import React from 'react'
import styled from 'styled-components'
import logo2 from '../images/logo-2.svg'


function NavBar() {
    return (
        <NavBarr>
            <NavBarContainer>
                <div className='logo'>
                    <img src={logo2} alt="" srcset="" />
                </div>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Blogs</li>
                </ul>
            </NavBarContainer>
        </NavBarr>
    )
}

export default NavBar

const NavBarr = styled.div`
display: flex;
flex-direction: row;
justify-content: left;
align-items: center;
font-family: 'Rubik Wet Paint', cursive; 
`
const NavBarContainer = styled.div`
width: 50%;
height: 10vh;

display: flex;
justify-content: left;
align-items: center;

.logo {
    width: 30%;
    display: flex;
    justify-content:center;
    img {
    color: #DAA520;
    width: 40px;
}
}

ul {
 text-decoration: none;
 display: flex;
 justify-content: space-between;
 width: 50%;
position: relative;


 li {
     list-style: none;
     cursor:pointer;
    position: relative;
     }
     li::before {
         content: '';
         position: absolute;
         width: 5%;
         height: 3vh;
         background-color: #DAA520;
         top: 0;
         left: -10%;
         opacity: 0.5;
 }
 li:hover::before {
     width: 150%;
 }
}
`
